import React from 'react';
import Card from './Card';

const CardList = ({ kanji }) => {
	// const cardComponent = kanji.map((kanji, i) => { 
	// 	return <Card character={kanji.character} reading={kanji.kunyomi+" "+kanji.onyomi} meaning={kanji.meaning}   />;
	// })

	return(		
		<div>
			<Card character={kanji[0].character} reading={kanji[0].kunyomi+" "+kanji[0].onyomi} meaning={kanji[0].meaning} />
			// {cardComponent}
		</div>

	);
}

export default CardList;


